import React from "react";

const Map = () => {
  const arr = [15, 16, 14, 15, 14, 18, 18, 47];
  return(
    <>
        {
            arr.map(()=>
            {
                <h1>
                    hello world
                </h1>
            })
        }
    </>
  )
};
